import React from 'react';

import { Container, Tag, ImgContainer } from './styles';
import { AiFillDelete } from 'react-icons/ai';


interface IHistoryFinanceCardProps {
    tagColor: string;
    title: string;
    subtitle: string;
    amount: string;
}

const HistoryFinanceCard: React.FC<IHistoryFinanceCardProps> = ({
    tagColor,
    title,
    subtitle,
    amount
}) => (
    <Container>
        <Tag color={tagColor} />
        <div>
            <span>{title}</span>
            <small>{subtitle}</small>
        </div>
        <ImgContainer>
            <h3>{amount}</h3>
            <AiFillDelete />
        </ImgContainer>
    </Container>
);

export default HistoryFinanceCard;
